import React, { useState, useEffect } from 'react';
import { supabase } from '../../supabaseClient';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
} from 'chart.js';
import 'chartjs-adapter-date-fns';
import AnxietyRiskChart from '../../components/charts/AnxietyRiskChart';
import { PM25Chart, CityComparisonChart } from '../../components/charts';

// Register Chart.js components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
);

const AVAILABLE_CITIES = [
  'Boston',
  'Calgary',
  'Dallas',
  'Miami',
  'New York',
  'San Francisco',
  'Toronto'
];

const Dashboard = () => {
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);
  const [data, setData] = useState({
    pm25Data: [],
    cityData: []
  });
  const [selectedCity, setSelectedCity] = useState('');
  const [userPreferences, setUserPreferences] = useState({
    hasHVAC: false,
    hasEcologica: false
  });

  useEffect(() => {
    const loadDashboard = async () => {
      setIsLoading(true);
      setError(null);
      try {
        // First check if we have an authenticated session
        const { data: { session }, error: sessionError } = await supabase.auth.getSession();

        if (sessionError) {
          throw new Error('Authentication error. Please log in again.');
        }

        if (!session) {
          throw new Error('Please log in to view your dashboard.');
        }

        // Then fetch user preferences
        const { data: preferences, error: prefError } = await supabase
          .from('user_preferences')
          .select('*')
          .eq('user_id', session.user.id)
          .single();

        if (prefError) {
          throw new Error('Error loading preferences');
        }

        setUserPreferences({
          hasHVAC: preferences?.has_HVAC || false,
          hasEcologica: preferences?.has_ecologicca || false
        });

        // Fetch the user's preferred city from Supabase
        const fetchUserPreferences = async () => {
          const { data: { user } } = await supabase.auth.getUser();
          if (user) {
            const { data: preferences, error } = await supabase
              .from('user_preferences')
              .select('city, has_HVAC, has_ecologicca')
              .eq('user_id', user.id)
              .single();

            if (!error && preferences) {
              setSelectedCity(preferences.city);
              fetchData(preferences.city);
            }
          }
        };

        fetchUserPreferences();

      } catch (err) {
        setError(err.message);
        console.error('Dashboard loading error:', err);
      } finally {
        setIsLoading(false);
      }
    };

    loadDashboard();
  }, []);

  const fetchData = async (city) => {
    try {
      // Fetch PM2.5 data for selected city
      const { data: pm25Data, error: pm25Error } = await supabase
        .from('weather_data')
        .select('created_at, pm25')
        .eq('city', city)
        .order('created_at', { ascending: true });

      if (pm25Error) throw pm25Error;

      // Fetch data for all cities
      const { data: cityData, error: cityError } = await supabase
        .from('weather_data')
        .select('city, pm25')
        .order('created_at', { ascending: false });

      if (cityError) throw cityError;

      // Get the most recent data point for each city
      const latestCityData = cityData.reduce((acc, curr) => {
        if (!acc[curr.city] || new Date(curr.created_at) > new Date(acc[curr.city].created_at)) {
          acc[curr.city] = curr;
        }
        return acc;
      }, {});

      setData({
        pm25Data,
        cityData: Object.values(latestCityData)
      });

    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  if (error) {
    return (
      <div className="dashboard-error">
        <h2>Error Loading Dashboard</h2>
        <p>{error}</p>
        {/* Add a retry button or login redirect as needed */}
      </div>
    );
  }

  if (isLoading) {
    return (
      <div className="dashboard-loading">
        <h2>Loading your dashboard...</h2>
        {/* Add a loading spinner if desired */}
      </div>
    );
  }

  return (
    <div className="dashboard">
      <div className="dashboard-content">
        <h1>Air Quality Dashboard - {selectedCity || 'Loading...'}</h1>

        <div className="content-wrapper">
          <div className="chart-side">
            <div className="chart-container">
              <div className="chart">
                <h3>PM2.5 Levels Over Time</h3>
                {data.pm25Data.length > 0 ? (
                  <PM25Chart 
                    data={data.pm25Data} 
                    userPreferences={userPreferences}
                  />
                ) : (
                  <p>Loading PM2.5 data...</p>
                )}
              </div>
              <div className="chart">
                <h3>City Comparison</h3>
                {data.cityData.length > 0 ? (
                  <CityComparisonChart 
                    data={data.cityData} 
                    selectedCity={selectedCity}
                    userPreferences={userPreferences}
                  />
                ) : (
                  <p>Loading city comparison data...</p>
                )}
              </div>
            </div>
          </div>

          <div className="data-side">
            <div className="key-data-points">
              <div className="key-data-title">Your Air Quality Systems:</div>
              <div className="key-data-point">
                {userPreferences.hasHVAC && <p>✓ HVAC System (30% reduction)</p>}
                {userPreferences.hasEcologica && <p>✓ Ecologicca (40% reduction)</p>}
                {userPreferences.hasHVAC && userPreferences.hasEcologica && (
                  <p>✓ Combined Systems (50% total reduction)</p>
                )}
                {!userPreferences.hasHVAC && !userPreferences.hasEcologica && (
                  <p>No systems selected</p>
                )}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
